import React from 'react'
import {IProduct} from '../model'

interface ProductProps{
    product: IProduct
}


const Product = ({product}: ProductProps) => {
  return (
    <div className='grid col-span-5 gap-7'>
        <div>
        {product.id}
        </div>
        <div>
        {product.title}
        </div>
        <div>
        {product.price}
        </div>
        <div>
        {product.description}
        </div>
        <div>
        {product.category}
        </div>
    </div>
  )
}

export default Product
